import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";
import Hero from "./components/Hero";
import Content from "./components/Content";
import ContentWrapper from "./components/ContentWrapper";
import Horizontal_Scroller from "./components/Horizontal_Scroller";
import Recommendation from "./components/Recommendation";

export {
  Home,
  Movies,
  Single_Movie,
  Genres,
  People,
  About,
} from "./pages/index";

function App() {
  return (
    <>
      <Navbar />
      <Sidebar />
      <ContentWrapper>
        <Content>
          <Hero />
          <Recommendation />
          <Horizontal_Scroller />
          <Horizontal_Scroller />
        </Content>
      </ContentWrapper>
    </>
  );
}

export default App;
